import config from  './config';
const getToken =(user )=>{
    return jwt.sign({
        id: user.id,
        name: user.name,
        email: user.email,
        isAdmin: user.isAdmin,
    }, config.JWT_SECERET,{
        expiresIn: '48h' 
    })
}
